  false,\n\t\"url\": null,\n\t\"notes\": \"The objective of this project was to investigate
  whether cooperative biomass surveys can be an effective way to manage fisheries
  at the local scales that are important to predators such as Steller sea lions. To
  satisfy this objective we conducted wintertime (February-March) acoustic surveys
  of pollock in the central Aleutian Islands from a commercial vessel equipped with
  scientific quality ES60 echosounders in 2006, through 2008, and from a NOAA research
  vessel in 2008. With the fishery vessel and the NOAA vessel acoustic data, we documented
  the distribution of wintertime aggregations of spawning pollock in the central Aleutian
  Islands.  We found that aggregations were stable within the season and consistent
  between years.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
